var assert = require('assert');
const fs = require('fs');
const chai = require('chai');
  
chai.use(require('chai-http'));
let app = require('../../app.js');

describe('Convert', function () {
  describe('convert image to base64', function () {
    it('should return status 200 ok', function (done) {
      chai.request(app)
        .post('/convert')
        .attach('image', fs.readFileSync(__dirname + '/../../img/yoda.jpeg'), 'yoda.jpeg')
        .end(function (err, res) {
          if(err) console.error(err);
          
          assert.equal(res.status, 200, "Status");
          assert.deepEqual(res.body, { image: { filename: 'yoda.jpeg', contentType: 'image/jpeg',base64:"" } }, "Body");
          done();
        });
    });
  });
});